    [],nt"revision_timestamp": "2015-01-22T15:57:54.809919",nt"name": "nsp-activities-by-tract",nt"isopen":
    false,nt"url": null,nt"notes": "The data being displayed are census tract
    level counts of NSP-funded activities and is derived from an extract of HUD's Community
    Planning and Developmentu0092s (CPD) Disaster Recovery Grants Reporting (DRGR) System.
    Each observation in the raw DRGR extract is an address at which an NSP activity
    took place. If multiple activities took place at one address, that address would
    be in the database multiple times and may over-count NSP activity. This situation
    is likely if a grantee reports the same property under an u0093acquisitionu0094
    activity and a u0093rehabu0094 activity. The data will also over-count NSP activity
    if grantees enter an activity at a single address in multiple quarterly performance
    reports. Conversely, if multiple units were assisted at a single address, that address
    may under-represent NSP activity. This situation is likely if a grantee reports
    a single address that actually represents a group of properties or a property with
    multiple units. The observations were reported by grantees as completed through
    March 31, 2011. A u0094completedu0094 activity has met its national objective; for
    NSP-funded units this frequently means it has been occupied by a low or moderate
    income household. Only addresses that were geocoded to a high level of accuracy
    were included.",nt"license_title": "License Not Specified",nt"extras":
